
CREATE TABLE `auth_group` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(150) NOT NULL UNIQUE);
CREATE TABLE `auth_group_permissions` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `group_id` integer NOT NULL REFERENCES `auth_group` (`id`) , `permission_id` integer NOT NULL REFERENCES `auth_permission` (`id`) );
CREATE TABLE `auth_permission` (`id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, `content_type_id` integer NOT NULL REFERENCES `django_content_type` (`id`) , `codename` varchar(100) NOT NULL, `name` varchar(255) NOT NULL);
CREATE TABLE `auth_user` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `password` varchar(128) NOT NULL, `last_login` datetime NULL, `is_superuser` bool NOT NULL, `username` varchar(150) NOT NULL UNIQUE, `last_name` varchar(150) NOT NULL, `email` varchar(254) NOT NULL, `is_staff` bool NOT NULL, `is_active` bool NOT NULL, `date_joined` datetime NOT NULL, `first_name` varchar(150) NOT NULL);
CREATE TABLE `auth_user_groups` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `user_id` integer NOT NULL REFERENCES `auth_user` (`id`) , `group_id` integer NOT NULL REFERENCES `auth_group` (`id`) );
CREATE TABLE `auth_user_user_permissions` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `user_id` integer NOT NULL REFERENCES `auth_user` (`id`) , `permission_id` integer NOT NULL REFERENCES `auth_permission` (`id`) );
CREATE TABLE `django_admin_log` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `object_id` text NULL, `object_repr` varchar(200) NOT NULL, `action_flag` smallint unsigned NOT NULL CHECK (`action_flag` >= 0), `change_message` text NOT NULL, `content_type_id` integer NULL REFERENCES `django_content_type` (`id`) , `user_id` integer NOT NULL REFERENCES `auth_user` (`id`) , `action_time` datetime NOT NULL);
CREATE TABLE `django_content_type` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `app_label` varchar(100) NOT NULL, `model` varchar(100) NOT NULL);
CREATE TABLE `django_migrations` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `app` varchar(255) NOT NULL, `name` varchar(255) NOT NULL, `applied` datetime NOT NULL);
CREATE TABLE `django_session` (`session_key` varchar(40) NOT NULL PRIMARY KEY, `session_data` text NOT NULL, `expire_date` datetime NOT NULL);
CREATE TABLE `production_budgets` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `month` date NOT NULL, `trucked` real NOT NULL, `hoisted` real NOT NULL, `gold` real NOT NULL, `grade` decimal NOT NULL, `drilling` real NOT NULL, `blasting` real NOT NULL);
CREATE TABLE `production_cost` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `date` date NOT NULL UNIQUE, `c1` decimal NOT NULL, `c2` decimal NOT NULL, `c3` decimal NOT NULL, `c1_cash_cost` decimal NOT NULL, `c2_cash_cost` decimal NOT NULL, `c3_cash_cost` decimal NOT NULL);
CREATE TABLE `production_costs` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `date` date NOT NULL UNIQUE, `c1` decimal NOT NULL, `c2` decimal NOT NULL, `c3` decimal NOT NULL, `c1_cash_cost` decimal NOT NULL, `c2_cash_cost` decimal NOT NULL, `c3_cash_cost` decimal NOT NULL, `gold_price` decimal NOT NULL);
CREATE TABLE `production_data` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `date` date NOT NULL UNIQUE, `ug_tonnes` real NOT NULL, `op_tonnes` real NOT NULL, `milled_tonnes` real NOT NULL, `dev_drilling` real NOT NULL, `ore_gen` real NOT NULL, `grade` decimal NOT NULL, `dowmtime` decimal NULL, `cil_feed_grade` decimal NULL, `reconciled_grade` decimal NULL, `gold` decimal NOT NULL);
CREATE TABLE `production_fatalityfreeshifts` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `date` date NOT NULL UNIQUE, `shifts` integer NOT NULL);
CREATE TABLE `production_goldprice` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `date` date NOT NULL UNIQUE, `price` decimal NOT NULL);
CREATE TABLE `production_plan` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `rom` real NOT NULL, `milled_tonnes` real NOT NULL, `gold` real NOT NULL, `grade` decimal NOT NULL, `dev_drilling` real NOT NULL, `ore_gen` real NOT NULL, `date` date NOT NULL UNIQUE);
CREATE TABLE `production_prod_downtime` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `date` date NOT NULL, `downtime` decimal NOT NULL, `reason` text NOT NULL, `section_id` bigint NOT NULL REFERENCES `production_sections` (`id`) );
CREATE TABLE `production_production_data` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `open_pit_tonnage` real NOT NULL, `cymric_tonnage` real NOT NULL, `cymric_day` real NOT NULL, `cymric_night` real NOT NULL, `bottom_section_total` real NOT NULL, `milled_tonnage` real NOT NULL, `trucked_tonnage` real NOT NULL, `date` date NOT NULL UNIQUE);
CREATE TABLE `production_safetyperformance` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `fatality` integer NOT NULL, `lti` integer NOT NULL, `nlti` integer NOT NULL, `date` date NOT NULL UNIQUE);
CREATE TABLE `production_sections` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `section` varchar(100) NOT NULL, `description` text NOT NULL);
CREATE TABLE `production_summaries` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `date` date NOT NULL, `tonnes_trucked` real NOT NULL, `tonnes_hoisted` real NOT NULL, `meters_drilled` decimal NOT NULL, `tonnes_blasted` real NOT NULL, `downtime` decimal NOT NULL, `grade` decimal NOT NULL, `gold` decimal NOT NULL);
CREATE TABLE `production_trammings` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `western_top` real NOT NULL, `cymric_top` real NOT NULL, `cymric_bottom` real NOT NULL, `l_13` real NOT NULL, `l_15` real NOT NULL, `far_east` real NOT NULL, `date` date NOT NULL UNIQUE, `cymric_bottom_grade` decimal NOT NULL, `cymric_top_grade` decimal NOT NULL, `far_east_grade` decimal NOT NULL, `l_13_grade` decimal NOT NULL, `l_15_grade` decimal NOT NULL, `western_top_grade` decimal NOT NULL);
